import "./Login.css";

const Login = ({loggedIn, setLoggedIn}) => {

    const handleLoginSubmit = event => {
        event.preventDefault();
        if(event.target.name.value === "login"){
            console.log("log in clicked");
        }
        if(event.target.value === "create"){
            console.log("create clicked");
        }
    }

    return (
        <div className={"Login"}>
            <form className={"loginForm"} onSubmit={event => handleLoginSubmit(event)}>
                <div className={"formRow"}>
                    <label>Username </label>
                    <input type={"text"} name={"username"}/>
                </div>
                <div className={"formRow"}>
                    <label>Password </label>
                    <input type={"text"} name={"password"}/>
                </div>
                <button className={"loginButton"} type={"submit"} name={"login"}>Login</button>
                <button className={"createButton"} type={"submit"} name={"create"}>Create</button>
            </form>
        </div>
    );
}

export default Login;
